        return "<div class=\"text-center\">\n                                                            <span style=\"color: black;\">".concat(row.jefatura, "</span><br>\n                                                            <a href=\"javascript:void(0)\" data-uno=\"").concat(row.nodo, "\" data-dos=\"").concat(row.troba, "\"\n                                                                class=\"shadow-sm font-weight-bold verDiagnosticoMasivo\" alt=\"Ver Diag\xF3stico Masivo\" title=\"Ver Diag\xF3stico Masivo\">\n                                                                [DM]\n                                                            </a>\n                                                        </div>");
